import React from 'react';
import items from '../data/items';
import OrderRow from './OrderRow';

function OrderTable() {
    return (
        <table>
            <caption>All Items: </caption>
            <thead>
                <tr>
                    <th>Item</th>
                    <th>Price</th>
                    <th>Quantity</th>
                </tr>
            </thead>
            <tbody>
            {items.map((item, i) => 
            <OrderRow item={item} key={i} />
            )}
            </tbody>
        </table>
    );
}

export default OrderTable;
